import React from 'react';
import { NavLink } from 'react-router-dom';

const Navbar = () => {

  const activeLink = 'navbar__li navbar__li-active';
  const notActiveLink = 'navbar__li';

  return (
    <nav className='navbar'>
      <p className='navbar__title'>
        <a href='/'><strong>Freelancer</strong> portfolio</a>
      </p>

      <ul className="navbar__list">
        <NavLink to='/projects' className={({isActive})=>  isActive? activeLink : notActiveLink}>Projects</NavLink>

        <NavLink to='/skills' className={'navbar__li'}>Skills</NavLink>

        <NavLink to='/contacts' className={'navbar__li'}>Contacts</NavLink>
      </ul>
    </nav>
  )
}

export default Navbar
